import { NavLink, useRouteMatch } from "react-router-dom";

const Icons = () => {
  const { url } = useRouteMatch();

  return (
    <>
      <div className={Style.container}>
        <div className={Style.searchBar}>
          <TextField placeholder="Buscar" />
          <img src={Search} alt="Lupa de pesquisa" />
        </div>
        <Button>
          <NavLink className={Style.buttons} to={`${url}/vehicleRegistration`}>Cadastro de veiculos</NavLink>
        </Button>
        <Button>
          <NavLink className={Style.buttons} to={`${url}/salesRegister`}>Cadastro de vendas</NavLink>
        </Button>
        <Button>
          <NavLink className={Style.buttons} to={`${url}/login`}>Login</NavLink>
        </Button>
      </div>
    </>
  );
};
